  #titleScreen h1{font-size:9vw;margin:0;text-shadow:0 0 10px #000;}
  #titleScreen p{font-size:4.5vw;margin:10px 0;text-shadow:0 0 8px #000;}

  #controls{display:none;position:fixed;bottom:15px;left:50%;transform:translateX(-50%);z-index:9;
    width:200px;height:160px;}

    border:2px solid #fff;display:flex;justify-content:center;align-items:center;user-select:none;}
  .btn:active{background:#fff;color:#000;}
  #up{left:70px;top:0;}
  #down{left:70px;bottom:0;}
  #left{left:0;top:50%;transform:translateY(-50%);}
  #right{right:0;top:50%;transform:translateY(-50%);}

</head>
<body>
<button id="muteBtn">🔊</button>

<div id="titleScreen">
  <h1>Cookie Challenge</h1>
  <p>Tap to start – grab the cookies, dodge the monsters!</p>
  <button id="startBtn">Start Game</button>
</div>

<p id="ui" style="display:none;">Score: 0</p>
<canvas id="gameCanvas"></canvas>

<!-- touch controls -->
<div id="controls">
  <div id="up"    class="btn"><span>▲</span></div>
  <div id="down"  class="btn"><span>▼</span></div>
  <div id="left"  class="btn"><span>◀</span></div>
  <div id="right" class="btn"><span>▶</span></div>
</div>

<audio id="bgm" src="bgm.mp3" loop></audio>

<script>
const TILE=20,PLAYER_SPEED=4,MONSTER_SPEED=2,COOKIE_R=6,MONSTER_R=12,PLAYER_R=10;
const cvs=document.getElementById('gameCanvas'),ctx=cvs.getContext('2d');
const ui=document.getElementById('ui'),bgm=document.getElementById('bgm');
const mute=document.getElementById('muteBtn'),title=document.getElementById('titleScreen'),
      startBtn=document.getElementById('startBtn');
const mobile=window.matchMedia("(pointer:coarse)").matches;
function resize(){
  let w=window.innerWidth, h=window.innerHeight-(mobile?180:60);
  cvs.width=w-20; cvs.height=h-20;
}
window.addEventListener('resize',resize); resize();
/* touch controls */
const dirs={up:false,down:false,left:false,right:false};
['up','down','left','right'].forEach(id=>{
  const el=document.getElementById(id);
  ['touchstart','mousedown'].forEach(ev=>el.addEventListener(ev,e=>{e.preventDefault();dirs[id]=true;}));
  ['touchend','touchcancel','mouseup','mouseleave'].forEach(ev=>el.addEventListener(ev,e=>{e.preventDefault();dirs[id]=false;}));
});
let player,cookies,monsters,score,gameOver,running;
const randPos=()=>({x:Math.random()*(cvs.width-40)+20, y:Math.random()*(cvs.height-40)+20});
const dist=(a,b)=>Math.hypot(a.x-b.x,a.y-b.y);
const AudioCtx=window.AudioContext||window.webkitAudioContext,audioCtx=new AudioCtx();
const tone=(f,d=150,t='sine',v=.4)=>{const o=audioCtx.createOscillator(),g=audioCtx.createGain();
o.type=t;o.frequency.value=f;g.gain.value=v;o.connect(g).connect(audioCtx.destination);
o.start();o.stop(audioCtx.currentTime+d/1000);};
const cookieSfx=()=>tone(880,100,'sine',.3),hitSfx=()=>tone(110,300,'square',.4),
      goSfx=()=>[660,440,220].forEach((f,i)=>setTimeout(()=>tone(f,150,'saw',.5),i*160));
function reset(){
  player={x:cvs.width/2,y:cvs.height/2,dx:0,dy:0};
  cookies=[];monsters=[];score=0;gameOver=false;
  for(let i=0;i<20;i++)cookies.push(randPos());
  for(let i=0;i<3;i++){let m=randPos(),a=Math.random()*Math.PI*2;
    m.dx=Math.cos(a)*MONSTER_SPEED;m.dy=Math.sin(a)*MONSTER_SPEED;monsters.push(m);}
  ui.textContent='Score: 0';
}
function start(){
  title.style.display='none';cvs.style.display='block';ui.style.display='block';
  reset();running=true;bgm.volume=.6;bgm.play();audioCtx.resume();loop();
}
startBtn.onclick=start;document.addEventListener('keydown',e=>{if(!running&&e.key!=='r')start();});
document.addEventListener('keydown',e=>{
  if(e.key==='r'&&gameOver){reset();running=true;bgm.currentTime=0;bgm.play();loop(); return;}
  if(e.key==='ArrowUp'||e.key==='w')player.dy=-PLAYER_SPEED;
  if(e.key==='ArrowDown'||e.key==='s')player.dy=PLAYER_SPEED;
  if(e.key==='ArrowLeft'||e.key==='a')player.dx=-PLAYER_SPEED;
  if(e.key==='ArrowRight'||e.key==='d')player.dx=PLAYER_SPEED;
});
document.addEventListener('keyup',e=>{
  if(['ArrowUp','w','ArrowDown','s'].includes(e.key))player.dy=0;
  if(['ArrowLeft','a','ArrowRight','d'].includes(e.key))player.dx=0;
});
function applyTouch(){ if(!mobile) return;
  player.dx=(dirs.left?-PLAYER_SPEED:0)+(dirs.right?PLAYER_SPEED:0);
  player.dy=(dirs.up?-PLAYER_SPEED:0)+(dirs.down?PLAYER_SPEED:0);
}
function update(){applyTouch();
  player.x=Math.max(PLAYER_R,Math.min(cvs.width-PLAYER_R,player.x+player.dx));
  player.y=Math.max(PLAYER_R,Math.min(cvs.height-PLAYER_R,player.y+player.dy));
  monsters.forEach(m=>{m.x+=m.dx;m.y+=m.dy;
    if(m.x<MONSTER_R||m.x>cvs.width-MONSTER_R)m.dx*=-1;
    if(m.y<MONSTER_R||m.y>cvs.height-MONSTER_R)m.dy*=-1;});
  cookies=cookies.filter(c=>{if(dist(c,player)<PLAYER_R+COOKIE_R){score+=10;ui.textContent='Score: '+score;cookieSfx();return false;} return true;});
  if(!cookies.length){for(let i=0;i<20;i++)cookies.push(randPos());
    let m=randPos(),a=Math.random()*Math.PI*2;m.dx=Math.cos(a)*MONSTER_SPEED;m.dy=Math.sin(a)*MONSTER_SPEED;monsters.push(m);}
  if(monsters.some(m=>dist(m,player)<PLAYER_R+MONSTER_R)){gameOver=true;running=false;hitSfx();goSfx();bgm.pause();}
}
function draw(){ctx.fillStyle='#000';ctx.fillRect(0,0,cvs.width,cvs.height);
  cookies.forEach(c=>{ctx.fillStyle='#d69c4e';ctx.beginPath();ctx.arc(c.x,c.y,COOKIE_R,0,Math.PI*2);ctx.fill();
    ctx.fillStyle='#925c27';ctx.beginPath();ctx.arc(c.x-2,c.y-1,2,0,Math.PI*2);ctx.fill();
    ctx.beginPath();ctx.arc(c.x+2,c.y+1,2,0,Math.PI*2);ctx.fill();});
  ctx.fillStyle='#4ec5f1';ctx.beginPath();ctx.arc(player.x,player.y,PLAYER_R,0,Math.PI*2);ctx.fill();
  monsters.forEach(m=>{ctx.fillStyle='#e63946';ctx.beginPath();ctx.arc(m.x,m.y,MONSTER_R,0,Math.PI*2);ctx.fill();
    ctx.fillStyle='#fff';ctx.beginPath();ctx.arc(m.x-4,m.y-3,3,0,Math.PI*2);ctx.fill();
    ctx.beginPath();ctx.arc(m.x+4,m.y-3,3,0,Math.PI*2);ctx.fill();
    ctx.fillStyle='#000';ctx.beginPath();ctx.arc(m.x-4,m.y-3,1.5,0,Math.PI*2);ctx.fill();
    ctx.beginPath();ctx.arc(m.x+4,m.y-3,1.5,0,Math.PI*2);ctx.fill();});
  if(gameOver){ctx.fillStyle='rgba(0,0,0,.7)';ctx.fillRect(0,0,cvs.width,cvs.height);
    ctx.fillStyle='#fff';ctx.textAlign='center';ctx.font='8vw sans-serif';
    ctx.fillText('Game Over',cvs.width/2,cvs.height/2-20);
    ctx.font='4vw sans-serif';ctx.fillText('Press R or 🡆 tap start to replay',cvs.width/2,cvs.height/2+20);}
}
function loop(){if(!running)return;update();draw();requestAnimationFrame(loop);}
mute.onclick=()=>{bgm.muted=!bgm.muted;mute.textContent=bgm.muted?'🔇':'🔊';};
</script>
</body>
</html>
